import React from "react";
import { BrowserRouter as Router, NavLink, Route, Routes } from 'react-router-dom';
import Home from "./Home.js";
import Contact from "../Contact.js";
// import {LogoHeader} from "../assets/Logo_Header";
const NavLinks = props => (
    <header>
        <div className="company-logo" >
            
            LongDino
        </div>
        <nav className="navbar">
        <ul className="nav-items">
            <li className="nav-item">
                <a href="www.google.com" className="nav-link">
                    <NavLink to="/">HOME</NavLink>
                </a>
            </li>
            <li className="nav-item">
                <a href="https://api.whatsapp.com/send?phone=+56936681029&text=Hola, Quisiera hacer unas consultas."  target="_blank" rel="noreferrer" className="nav-link">
                    <NavLink to="/Contact">CONTACT</NavLink>
                </a>
            </li>
        </ul>
        </nav>
        <div className="menu-toggle">
        <i className="bx bx-menu"></i>
        <i className="bx bx-x"></i>
        </div>
        <div className="linetop"></div>
    </header>
    

  )

function Navbar(){
    /* eslint-disable */
    return(
        <Router>
            <Switch>
                <Route exact strict path="/" component={Home} />
                <Route exact strict path="/Contact" component={Contact} />
            </Switch>   
        </Router>
    );
}
export default Navbar;
